  IF (UPDATING AND ((NEW.BASEPRICE_PROC_CODE IS NULL) OR (TRIM(NEW.BASEPRICE_PROC_CODE) = ''))) THEN
      SELECT LI.LABORISSUE_CODELITER||'_'||CAST(NEW.BASEPRICE_ID AS VARCHAR(5))
