                   A.ID_ANKETA
             FROM TBL_ANKETA A
             WHERE
                  A.ID_ANKETA = NEW.SHEDUL_LINKANKETA)) THEN
    UPDATE TBL_ANKETA A
    SET
      A.SHEDUL_EXISTS = 1
    WHERE
